import re
from typing import List, Set, Pattern

def find_unique_matches(strings: List[str], patterns: List[Pattern]) -> Set[str]:
    found = set()
    for string in strings:
        for p in patterns:
            for match in p.findall(string):
                if len(match) > 2 or match not in found:
                    found.add(match)
    return found

